import './Todo.css'
import TodoList from "../todo-list/TodoList"

const Todo = () => {
    const todas = [
        { id: 1, title: 'Eat'},
        { id: 2, title: 'Sleep'},
        { id: 3, title: 'Code'},
    ]

    return (
        <div>
            <h3>To List</h3>
            <TodoList datasTodos = {todos} />
        </div>
    )
}

export default Todo
